	add("precipice", "{\"term\":\"precipice\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"First attested in 1598, from Middle french (ca. 1400-1600) \u0027précipice\u0027 from Latin *\u0027\u0027 (praecipitium) from \u0027praeceps\u0027 (steep) from \u0027prae\u0027 + \u0027caput\u0027 (head) First meaning of the noun is recorded from 1632.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very steep cliff\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1719-\u0027\u0027 w:Daniel Daniel Defoe, \u0027w:Robinson Robinson Crusoe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I resolved to remove my tent from the place where it stood, which was just under the hanging \u0027\u0027precipice\u0027\u0027 of the hill; and which, if it should be shaken again, would certainly fall upon my tent\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The brink of a dangerous situation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"to stand on a \u0027\u0027precipice\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A headlong fall or descent\", \"priority\":6}]}, \"synonyms\":{}}");

