	add("precipitation", "{\"term\":\"precipitation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027précipitation\u0027 from Latin \u0027praecipitatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any or all of the forms of water particles, whether liquid or solid, that fall from the atmosphere (e.g., rain, hail, snow or sleet). It is a major class of hydrometeor, but it is distinguished from cloud, fog, dew, rime, frost, etc., in that it must fall. It is distinguished from cloud and virga in that it must reach the ground\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hurried headlong fall\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A reaction that leads to the formation of a heavier solid in a lighter liquid; the precipitate so formed at the bottom of the container\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unwise or rash rapidity; sudden haste\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"had acted with some \u0027precipitation\u0027 and had probably started out upon a wild-goose chase -- Wikipedia:Dorothy Dorothy Sayers\", \"priority\":5}]}, \"synonyms\":{}}");

