	add("predecessor", "{\"term\":\"predecessor\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027prae\u0027 (before) + \u0027decedo\u0027 (go away) \u0026lt;ref\u0026gt;Funk, W. J., \u0027Word origins and their romantic stories\u0027, New York, Wilfred Funk, Inc.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who precedes; one who has preceded another in any state, position, office, etc.; one whom another follows or comes after, in any office or position\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A model or type of machinery or device which precedes the current one. Usually used to describe an earlier, outdated model\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The steam engine was the predecessor of diesel and electric locomotives\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A vertex having a directed path to another vertex\", \"priority\":4}]}, \"synonyms\":{}}");

