	add("predestination", "{\"term\":\"predestination\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027predestination\u0027 from \u0027praedestinatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine that everything has been foreordained by a God, especially that certain people have been elected for salvation, and sometimes also that others are destined for reprobation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Destiny or fate\", \"priority\":2}]}, \"synonyms\":{}}");

