	add("predicament", "{\"term\":\"predicament\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from \u0027praedicamentum\u0027 (that which is predicated, a predicament, category, {{etyl) also a preaching, discourse}}, from Latin \u0027praedicare\u0027 (to declare, proclaim, predicate) see \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A definite class, state or condition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unfortunate or trying position or condition; a tight spot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That which is predicated; a category\", \"priority\":3}]}, \"synonyms\":{}}");

