	add("predikant", "{\"term\":\"predikant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Dutch\"], \"text\":\"From South African Dutch \u0027predikant\u0027 (Afrikaans \u0027predikant\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A minister in the Dutch Reformed Church, or allied denomination\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 536\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One Sunday it would be an Anglican priest, the next a Dutch Reformed \u0027\u0027predikant\u0027\u0027, the next a Methodist minister\", \"priority\":3}]}, \"synonyms\":{}}");

	add("predilection", "{\"term\":\"predilection\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|prédilection|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Condition of favoring or liking; tendency towards; proclivity; predisposition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Edwin M. Yoder Jr., \u0026quot;Lewis Powell a Fine Sense of Balance,\u0026quot; \u0027Washington Post\u0027, 29 Jun\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But for him the first rule of judging was to set aside personal \u0027\u0027predilection\u0027\u0027 and vote the law and the facts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Terry McCarthy, \u0026quot;Lost Generation,\u0026quot; \u0027Time Asia\u0027, 23 Oct\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"youth’s \u0027\u0027predilection\u0027\u0027 for revolt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Marina Cantacuzino, \u0026quot;On deadly ground,\u0026quot; \u0027The Guardian\u0027, 13 Mar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Wilson doesn’t see any inconsistency between his socialism and his \u0027\u0027predilection\u0027\u0027 for the high life\", \"priority\":7}]}, \"synonyms\":{}}");

