	add("preface", "{\"term\":\"preface\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"1350–1400; Middle english (1100-1500) \u0027lang\u003denm\u0027 which is from Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 (from which derives the modern French \u0027lang\u003dfr\u0027 , from \u0027lang\u003dla\u0027 for classical Latin \u0027lang\u003dla|praefatio\u0027 () from \u0027lang\u003dla|praefor\u0027 () from \u0027prae-\u0027 (lang\u003dla) + \u0027for\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The beginning or introductory portion that comes before the main text of a document or book\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The book included a brief \u0027\u0027preface\u0027\u0027 by a leading expert in the field\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An introduction, or series of preliminary remarks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This superficial tale / Is but a \u0027\u0027preface\u0027\u0027 of her worthy praise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Heaven\u0027s high behest no \u0027\u0027preface\u0027\u0027 needs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The prelude or introduction to the canon of the Mass\", \"priority\":8}]}, \"synonyms\":{}}");

