	add("preference", "{\"term\":\"preference\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027preference\u0027 from \u0027preferentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The selection of one thing or person over others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The option to so select, and the one selected\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d1|page\u003d18|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/2013/jun/07/obama-apple-google-facebook-tainted-prism Obama\u0027s once hip brand is now passage\u003dWhere we once sent love letters in a sealed envelope, or stuck photographs of our children in a family album, now such private material is despatched to servers and clouds operated by people we don\u0027t know and will never meet. Perhaps we assume that our name, address and search \u0027\u0027preferences\u0027\u0027 will be viewed by some unseen pair of corporate eyes, probably not human, and don\u0027t mind that much\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of being preferred over others\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A strong liking or personal valuation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A preferential bias; partiality; discrimination\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Preferans, a card game, principally played in Eastern Europe\", \"priority\":7}]}, \"synonyms\":{}}");

