	add("prefix", "{\"term\":\"prefix\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prefixer\u0027 (verb) resp. \u0027praefixum\u0027 (noun), both from Latin \u0027praefixus\u0027 past participle of \u0027praefīgō\u0027 (i (fix, fasten, set up) in front”, “i fix on the (end, extremity)) (from \u0027prae-\u0027 (before) + \u0027fīgō\u0027 (i fix”, “i fasten”, “i affix) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is prefixed; especially one or more letters or syllables added to the beginning of a word to modify its meaning; as, \u0027pre-\u0027 in prefix, \u0027con-\u0027 in conjure\", \"priority\":1}]}, \"synonyms\":{\"list\":[{\"text\":\"foresyllable\", \"synonymQualifier\":\"RARE\"},{\"text\":\"prefixum\", \"synonymQualifier\":\"ARCHAIC\"}]}}");

	add("prefixa", "{\"term\":\"prefixa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1924\u0027\u0027: w:William William Shakespeare and Bastiaan Adriaan Pieter van Dam [ed.], \u0027The text of Shakespeare’s Hamlet, by B.A.P. van Dam\u0027, [http://books.google.co.uk/books?lr\u003d\u0026amp;id\u003dsosRAAAAMAAJ\u0026amp;dq\u003d%22prefixa%22+-prafix\u0026amp;q\u003d%22Transpositions+of+stage+directions+and+prefixa%22\u0026amp;pgis\u003d1 contents page] (J. Lane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Intended transpositions. Transpositions that are misprints. Transpositions of stage directions and \u0027\u0027prefixa\u0027\u0027 . . . . . . . . 120 — 125\", \"priority\":2}]}, \"synonyms\":{}}");

	add("preformationism", "{\"term\":\"preformationism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|preformation|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the theory that all organisms start their existence already in a predetermined form upon conception and this form does not change in the course of their lifetime (as opposed to epigenesis\", \"priority\":1}]}, \"synonyms\":{}}");

