	add("pregorexia", "{\"term\":\"pregorexia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|pregnancy|anorexia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition where a pregnant mother is obsessed with being thin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jane Bainbridge, \u0026quot;\u0027\u0027Pregorexia\u0027\u0027: body image over baby?\u0026quot; (article), in \u0027British Journal of Midwifery\u0027, Volume 16, Issue 9, September 4 2008, page 608\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Kevin Courtney, \u0026quot;Pregorexia\u0026quot;, \u0027The Irish Times\u0027, 7 July 2009\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Pregorexia\u0027\u0027 came on the radar in 2006 when former TV presenter Liz Fraser told Marie Claire magazine about her struggle with bulimia during pregnancy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Alison Smith-Squire, \u0026quot;[http://www.dailymail.co.uk/health/article-2109308/Pregnant-mother-worried-getting-fat-anorexic.html The \u0027pregorexic\u0027 mother whose weight plummeted to FOUR STONE because she was so worried about getting fat during pregnancy]\u0026quot;, \u0027Daily Mail\u0027, 2 March 2012\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Her dramatic weight loss meant Mrs Bassett had to be taken into hospital when just 11 weeks pregnant. Evan was born early at 30 weeks, but her ‘\u0027\u0027pregorexia\u0027\u0027’ left her too frail to care for him until he was 14 months old\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Emily Hourican, \u0027How to (Really) Be a Mother\u0027, Gill \u0026amp; Macmillan (2013), ISBN 9780717158461, [http://books.google.com/books?id\u003dKe34AwAAQBAJ\u0026amp;pg\u003dPT69\u0026amp;dq\u003d%22pregorexia%22 unnumbered page\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Pregorexia\u0027\u0027, or \u0027mommyrexia\u0027, as they dub it Stateside, is a growing disorder: women exercising madly all through the pregnancy (there are now scores of websites devoted to selling workout gear for pregnant women, while sizes for maternity clothes these days often include an extra-small, which would be impossibly tiny even for the average non-pregnant woman\", \"priority\":8}]}, \"synonyms\":{}}");

	add("prehabilitation", "{\"term\":\"prehabilitation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|rehabilitation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of strength training that aims to prevent injuries before they can occur\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preheater", "{\"term\":\"preheater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|preheat|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An engineering device that preheats a material prior to some other process\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preheritance", "{\"term\":\"preheritance\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|pre-|inheritance|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Transfer of property to relatives or other beneficiaries prior to death\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prehormone", "{\"term\":\"prehormone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|hormone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A substance secreted by glandular tissue that has little or no significant biological activity, but is converted in peripheral tissues into an active hormone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prehypertension", "{\"term\":\"prehypertension\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A blood pressure higher than normal but not high enough to be considered hypertension\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preimage", "{\"term\":\"preimage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|image|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The set containing exactly every member of the domain of a function such that the member is mapped by the function onto an element of a given subset of the codomain of the function. Formally, of a subset \u0027B\u0027 of the codomain \u0027Y\u0027 under a function ƒ, the subset of the domain \u0027X\u0027 defined b\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;math\u0026gt;f^{-1}(B) \u003d {x in X : f(x) in B }.\u0026lt;/math\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For example, the preimage of {4, 9} under the squaring function is the set {−3,−2,+2,+3\", \"priority\":3}]}, \"synonyms\":{}}");

	add("preincubating", "{\"term\":\"preincubating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"incubating in advance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prejudice", "{\"term\":\"prejudice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|prejudice}}, from Latin \u0027praeiūdicium\u0027 (previous judgment or damage) from \u0027prae-\u0027 (before) + \u0027iūdicium\u0027 (judgment)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An adverse judgment or opinion formed beforehand or without knowledge of the facts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Though often misled by \u0027\u0027prejudice\u0027\u0027 and passion, he was emphatically an honest man\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any preconceived opinion or feeling, whether positive or negative\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An irrational hostile attitude, fear or hatred towards a particular group, race or religion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I am free of all \u0027\u0027prejudices\u0027\u0027. I hate everyone equally\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Knowledge formed in advance; foresight, presaging\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"II.ix\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the first did in the forepart sit, / That nought mote hinder his quicke \u0027\u0027preiudize\u0027\u0027: / He had a sharpe foresight, and working wit\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Mischief; hurt; damage; injury; detriment\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"England and France might, through their amity, / Breed him some \u0027\u0027prejudice\", \"priority\":10}]}, \"synonyms\":{}}");

	add("prekallikrein", "{\"term\":\"prekallikrein\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|kallikrein|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A serine protease that complexes with high-molecular-weight kininogen; the precursor of plasma kallikrein\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prelate", "{\"term\":\"prelate\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027prelat\u0027 from \u0027praelatus\u0027 from past participle of \u0027praeferre\u0027 (to prefer)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clergyman of high rank and authority, having jurisdiction over an area or a group of people; normally a bishop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hear him but reason in divinity, / You would desire the king were made a \u0027\u0027prelate\", \"priority\":3}]}, \"synonyms\":{}}");

	add("prelection", "{\"term\":\"prelection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the stem of Latin \u0027praelēctiō\u0027 (the act of reading aloud to others) from the perfect participle stem of \u0027praelegō\u0027 (read something to others)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A public lecture or reading, especially delivered at a college or university\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, Mary Noailles Murfree, \u0027In the \u0026quot;Stranger People\u0027s\u0026quot; Country\u0027, Nebraska 2005, p. 80\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘I\u0027d like ter put ye in thar,’ replied Cheever, who had stolidly eyed him during this \u0027\u0027prelection\", \"priority\":3}]}, \"synonyms\":{}}");

	add("prelude", "{\"term\":\"prelude\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prelude\u0027 (singing to test a musical instrument) from Latin \u0027preludium\u0027 from earlier Latin \u0027praeludere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An introductory or preliminary performance or event; a preface\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A short piece of music that acts as an introduction to a longer piece\", \"priority\":2}]}, \"synonyms\":{}}");

	add("premarket", "{\"term\":\"premarket\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|market|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The informal market in stocks and other securities, held before the official markets ope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Stocks are up in \u0027\u0027premarket\u0027\u0027 trading this morning\", \"priority\":2}]}, \"synonyms\":{}}");

	add("premastication", "{\"term\":\"premastication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|mastication|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of chewing food for the purpose of physically breaking it down in order to feed another individual\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prematureness", "{\"term\":\"prematureness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being premature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prematurity", "{\"term\":\"prematurity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|premature|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the condition of a baby being premature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("premeasurement", "{\"term\":\"premeasurement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|measurement|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"measurement before some other operatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The preparation of a system for obtaining a desired result, typically the confinement of an object system in a small but macroscopic region of space-time\", \"priority\":2}]}, \"synonyms\":{}}");

	add("premillennialism", "{\"term\":\"premillennialism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|premillennial|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A concept in Christian eschatology that the second coming will happen before the millennium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 912\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Premillennialism\u0027\u0027 stressed division and separation within society, to gather in the elect, and its frostiness to Enlightenment projects of social reform contributed to that peculiar process by which ‘liberal’ has become a word of abuse in the United States, in sharp contrast to its esteem in European society\", \"priority\":3}]}, \"synonyms\":{}}");

	add("premise", "{\"term\":\"premise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027premisse\u0027 from \u0027premissa\u0027 (lang\u003dla) (\u0027\u0027 (premissa propositio) , feminine past participle of Latin \u0027praemitto\u0027 from \u0027prae-\u0027 (lang\u003dla) + \u0027mitto\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proposition antecedently supposed or proved; something previously stated or assumed as the basis of further argument; a condition; a supposition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027premises\u0027\u0027 observed, / Thy will by my performance shall be served\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of the first propositions of a syllogism, from which the conclusion is deduced\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dr. H. Mor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"While the \u0027\u0027premises\u0027\u0027 stand firm, it is impossible to shake the conclusion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Matters previously stated or set forth; especially, that part in the beginning of a deed, the office of which is to express the grantor and grantee, and the land or thing granted or conveyed, and all that precedes the habendum; the thing demised or granted\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A piece of real estate; a building and its adjuncts (in this sense, used most often in the plural form\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dNothing was too small to receive attention, if a supervising eye could suggest improvements likely to conduce to the common welfare. Mr. Gordon Burnage, for instance, personally visited dust-bins and back \u0027\u0027premises\u0027\u0027, accompanied by a sort of village bailiff, going his round like a commanding officer doing billets\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The fundamental concept that drives the plot of a film or other story\", \"priority\":9}]}, \"synonyms\":{}}");

	add("premix", "{\"term\":\"premix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|mix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A blend of components that has been mixed in advance of use or of further processing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, G. Bickley Remmey, \u0027Firing Ceramics\u0027, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 120\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"High velocity \u0027\u0027premix\u0027\u0027 systems — high velocity \u0027\u0027premix\u0027\u0027 burner systems have been popular with some European kiln builders due to the fact that they are more fuel efficient than most other systems\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Robin Beauchamp, \u0027Designing Sound for Animation\u0027, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 143\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As the postproduction phase nears completion, elements (units) are mixed-down to \u0027\u0027premixes\u0027\u0027 (predub). \u0027\u0027Premixes\u0027\u0027 are developed independently for each of the stems\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Hilary Wyatt, Tim Amyes, \u0027Audio Post Production For Television And Film\u0027, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 238\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Premixes\u0027\u0027 can be divided down into groups such as dialogue, effects and music, or even further, into \u0027\u0027premixes\u0027\u0027 of spot effects, foley effects, atmosphere effects, etc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, M. J. McPherson, S. G. Møller, \u0027PCR\u0027, 2nd Edition, Taylor \u0026amp; Francis, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 80\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Where possible you should prepare a \u0027\u0027premix\u0027\u0027 containing the common reactants for all the PCRs you are setting up\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, John Purcell, \u0027Dialogue Editing for Motion Pictures: A Guide to the Invisible Art\u0027, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 311\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"In comparison, dialogue editors have it pretty easy. Still, like the gymnast, for the past few weeks you′ve been preparing for one brief, intense experience: the dialogue \u0027\u0027premix\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Robert Blair, \u0027Nutrition and Feeding of Organic Poultry\u0027, %22premixes%22+-intitle:%22premix%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZAzsT8P2F6feigfnhPXlBQ\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22premixes%22%20-intitle%3A%22premix%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 223\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"When vitamins and minerals are combined in a single \u0027\u0027premix\u0027\u0027, it should be used within 30 days of purchase. Vitamin and trace mineral \u0027\u0027premixes\u0027\u0027 should be stored in the dark in dry sealed containers\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A manufactured beverage consisting of alcohol and soft drink, milk or other non-alcoholic drinks; an alcopop\", \"priority\":20}]}, \"synonyms\":{}}");

	add("premodifier", "{\"term\":\"premodifier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|modifier|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A modifier placed before the head of the phrase\", \"priority\":1}]}, \"synonyms\":{}}");

	add("premolar", "{\"term\":\"premolar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tooth situated in front of the molar teeth; especially a tooth in humans with two cusps which is between the canines and the molars (latin: \u0027singular\u0027 \u0027\u0027dens premolaris\u0027\u0027, \u0027plural\u0027 \u0027\u0027dentes premolares\", \"priority\":1}]}, \"synonyms\":{}}");

	add("premouse", "{\"term\":\"premouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|mouse|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A generalization of a mouse that is not necessarily iterable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("premunition", "{\"term\":\"premunition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"immunization due to having had the disease befor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Premunition\u0027\u0027 to chickenpox\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prender", "{\"term\":\"prender\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027prendre\u0027 (to take) from Latin {{lena}} \u0027prehendere\u0027 (to take)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The power or right of taking a thing before it is offered\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preocclusion", "{\"term\":\"preocclusion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|occlusion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The (phonological process, seen for example in Manx, of) insertion of a short stop before a sonorant, such as a [d] before an [n] or [l] (resulting in the preoccluded consonants [ᵈn] and [ᵈl\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preoccupation", "{\"term\":\"preoccupation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027préoccupation\u0027 from Latin \u0027praeoccupatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being preoccupied or an idea that preoccupies the mind; enthrallment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of occupying something before someone else\", \"priority\":2}]}, \"synonyms\":{}}");

	add("preoperculum", "{\"term\":\"preoperculum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|operculum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The anterior opercular bone in fishes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preorganization", "{\"term\":\"preorganization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|organization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"organization in advance of some other process or event\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prepackaging", "{\"term\":\"prepackaging\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"packaging applied prior to an object being sold\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preparation", "{\"term\":\"preparation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027préparation\u0027 from Latin \u0027praeparatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of preparing or getting ready\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is prepared\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A substance, especially a remedy, that is prepared\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The traditional remedy is a bitter \u0027\u0027preparation\u0027\u0027 made from steamed herbs\", \"priority\":4}]}, \"synonyms\":{}}");

	add("preparedness", "{\"term\":\"preparedness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prepared|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being prepared\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"preparedness\u0027\u0027 for battle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"preparedness\u0027\u0027 for an exam\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Precautionary measures in the face of potential disasters\", \"priority\":4}]}, \"synonyms\":{}}");

	add("preparty", "{\"term\":\"preparty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|party|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A party held before the start of an event, usually a public event\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prephilately", "{\"term\":\"prephilately\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|philately|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of philately concerned with postal systems prior to the introduction of postage stamps\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prepossession", "{\"term\":\"prepossession\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Preoccupation; having possession beforehand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A preconceived opinion, or previous impression; bias, prejudice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, p. 386\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The spontaneous intellect of man always defines the divine which it feels in ways that harmonise with its temporary intellectual \u0027\u0027prepossessions\", \"priority\":4}]}, \"synonyms\":{}}");

	add("preproduction", "{\"term\":\"preproduction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All the preliminary arrangements that are made before the start of a project, especially before the filming of a movie\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prepster", "{\"term\":\"prepster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prep|ster|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A student at a prep school\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who dresses or behaves in a way thought characteristic of such a student\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prepuce", "{\"term\":\"prepuce\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027prepuce\u0027 (foreskin) from Old french (842-ca. 1400) from Latin \u0027praeputium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The foreskin, or retractable fold of tissue covering the tip (glans) of the penis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, Jehovah, collector of \u0027\u0027prepuces\u0027\u0027, is no more. — James Joyce, \u0027Ulysses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, But there are a fair number of halfway Jews – you know, those who want God without having to have their \u0027\u0027prepuces\u0027\u0027 torn off to get him. — Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The corresponding part of the clitoris\", \"priority\":4}]}, \"synonyms\":{}}");

	add("prequalification", "{\"term\":\"prequalification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|qualification|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"qualification in advance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prequel", "{\"term\":\"prequel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Patterned after \u0027sequel\u0027 () using \u0027pre-\u0027 (before)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In a series of works, an installment that is set chronologically before its predecessor, especially the original narrative or (perhaps improper usage) any narrative work with at least one sequel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Patrick Robertson, \u0027Movie Facts and Feats: A Guinness Record Book\u0027, New York: Sterling Publishing, p. 43\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Prequels\u0027 are sequels that relate the story that \u0027preceded\u0027 the original film\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, 26 February, Andrew Pierce, \u0026quot;JRR Tolkien\u0027s estate to sue Lord of the Rings filmmakers New Line Cinema over profits, in \u0027w:The Daily The Daily Telegraph\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They are also threatening to block the production of the long-awaited \u0027\u0027prequel\u0027\u0027, The Hobbit, which may now be cancelled\", \"priority\":5}]}, \"synonyms\":{}}");

	add("preraphaelism", "{\"term\":\"preraphaelism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine or practice of a school of modern painters who profess to be followers of the painters before Raphael. Its adherents advocate careful study from nature, delicacy and minuteness of workmanship, and an exalted and delicate conception of the subject\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prerogative", "{\"term\":\"prerogative\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From the Anglo-norman noun \u0027prerogative\u0027 from Latin \u0027praerogātīva\u0027 (previous verdict; claim, privilege) noun use of the feminine singular of \u0027praerogativus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hereditary or official right or privilege\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A right, or power that is exclusive to a monarch etc, especially such a power to make a decision or judgement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A right, generall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Patrick Robinson, \u0027The Shark Mutiny\u0027, page 48\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Ah, that\u0027s your \u0027\u0027prerogative\u0027\u0027 as an Intelligence officer, Jimmy. But it\u0027s been your \u0027\u0027prerogative\u0027\u0027 for weeks, months, and nothing has happened, as I told you \u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Joel Osteen, \u0027Your best life now: 7 steps to living at your full potential\u0027, page 92\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If you want to wear your hair a certain way, that\u0027s your \u0027\u0027prerogative\u0027\u0027. You don\u0027t have to check with all your friends to make sure it\u0027s okay\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Tracy Hogg, Melinda Blau, \u0027Secrets of the Baby Whisperer: How to Calm, Connect, and Communicate\u0027, page 56\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If you choose another approach — that\u0027s your \u0027\u0027prerogative\u0027\u0027. But the problem is that parents often don\u0027t realize they\u0027re making the choice\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A property, attribute or ability which gives one a superiority or advantage over others; an inherent advantage or privilege; a talent\", \"priority\":10}]}, \"synonyms\":{}}");

	add("preroll", "{\"term\":\"preroll\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|roll|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period of time during which the camera rolls but before the action begins\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An advertisement that plays before the main content\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prerun", "{\"term\":\"prerun\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|run|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of running something in advance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Albert Y. Zomaya, Young Choon Lee, \u0027Energy Efficient Distributed Computing Systems\u0027 (page 66\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"several \u0027\u0027preruns\u0027\u0027 of an application to collect the execution time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Kaj Johansson, Peter Lundberg, Robert Ryberg, \u0027A Guide to Graphic Print Production\u0027 (page 295\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The digital print is also used for test runs and \u0027\u0027preruns\", \"priority\":5}]}, \"synonyms\":{}}");

	add("preso", "{\"term\":\"preso\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{m|en|presentation}} {{suffix||o|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"presentation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 August 30, Eric Krock, “CodeStock E1 speakers: coordinating Gecko/JS embedding presentations”, \u0026lt;tt\u0026gt;netscape.public.mozilla.embedding\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We need to provide a pause of \u0026quot;down time\u0026quot; after each \u0027\u0027preso\u0027\u0027 for the streaming team to save the captured video to disk before beginning the next presentation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 August, J. D. Richard, \u0027Oh, Crapper!\u0027, page 245, Xlibris Corporatio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Now that I\u0027ve finished Russ\u0027s \u0027\u0027preso\u0027\u0027, neither do I\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 March 11, Carey Matthew Black, “AR System Presentation”, \u0026lt;tt\u0026gt;Remedy ARS\u0026lt;/tt\u0026gt;, \u0027Google Groups\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sorry no formal \u0027\u0027preso\u0027\u0027 for you, but the first point is a real killer in my book\", \"priority\":7}]}, \"synonyms\":{}}");

	add("presage", "{\"term\":\"presage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027presage\u0027 from Latin \u0027praesagium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A warning of a future event; an omen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An intuition of a future event; a presentiment\", \"priority\":2}]}, \"synonyms\":{}}");

