	add("presbyopia", "{\"term\":\"presbyopia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from Ancient greek (to 1453) \u0027πρέσβυς\u0027 (old man) and \u0027-opia\u0027 (vision problem) from Ancient greek (to 1453) \u0027ὤψ\u0027 (eye) \u0026lt;ref\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inability of the eye, due to ageing, to focus on nearby objects; farsightedness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("presbypropria", "{\"term\":\"presbypropria\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πρέσβυς\u0027 (old) and \u0027proprius\u0027 (own)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inability of the proprioceptive system to accurately interpret actual limb position or movement due to physiological aging\", \"priority\":1}]}, \"synonyms\":{}}");

