	add("presbyterianism", "{\"term\":\"presbyterianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|presbyterian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That form of church government which invests presbyters with all spiritual power, and admits no prelates over them; also, the faith and polity of the Presbyterian churches, taken collectively\", \"priority\":1}]}, \"synonyms\":{}}");

	add("presbytership", "{\"term\":\"presbytership\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|presbyter|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office or station of a presbyter; presbyterate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("presbytery", "{\"term\":\"presbytery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|presbyter|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The home of a Roman Catholic parish priest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A body of elders in the early Christian church\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A section of the church reserved for the clergy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Presbyters collectively\", \"priority\":4}]}, \"synonyms\":{}}");

