	add("prescapula", "{\"term\":\"prescapula\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|scapula|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of the scapula in front of, or above, the spine, or mesoscapula\", \"priority\":1}]}, \"synonyms\":{}}");

