	add("prescriber", "{\"term\":\"prescriber\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|prescribe|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person, such as a physician, who prescribes medicatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the law made New Hampshire the first state to try to block pharmaceutical companies’ hard-sell pitches by restricting access to data that identifies doctors and other \u0027\u0027prescribers\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prescription", "{\"term\":\"prescription\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027prescripcion\u0027 from Latin \u0027praescriptio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of prescribing a rule, law, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Jurisdiction to \u0027\u0027prescribe\u0027\u0027\u0026quot; is a state\u0027s authority to make its laws applicable to certain persons or activities.\u0027 -- Richard G. Alexander, Iran and Libya Sanctions Act of 1996: Congress exceeds its jurisdiction to prescribe law. Washington and Lee Law Review, 1997\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Also called limitation and negative prescription. A time period within which a right must be exercised, unless the right will be extinguished\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Also called acquisitive prescription and positive prescription. A time period after which a person who has, in the role of an owner, uninterruptedly, peacefully, and publicly possessed another\u0027s property acquires the property. The described process is known as acquisition by prescription and adverse possession\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A written order, as by a physician or nurse practitioner, for the administration of a medicine or other intervention. See also scrip\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The surgeon wrote a \u0027\u0027prescription\u0027\u0027 for a pain killer and physical therapy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027prescription medicine\u0027 or intervention so prescribed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The pharmacist gave her a bottle containing her \u0027\u0027prescription\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The formal description of the lens geometry needed for spectacles, \u0027etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The optician followed the optometrist\u0027s \u0027\u0027prescription\u0027\u0027 for her new eyeglasses\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A piece of advice\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;Early to bed and early to rise\u0026quot; is a \u0027\u0027prescription\u0027\u0027 for a healthy lifestyle\", \"priority\":12}]}, \"synonyms\":{}}");

	add("prescriptiveness", "{\"term\":\"prescriptiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being prescriptive\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prescriptivism", "{\"term\":\"prescriptivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"prescribing idealistic norms, as opposed to describing realistic forms, of linguistic usage\", \"priority\":1}]}, \"synonyms\":{}}");

