	add("preseason", "{\"term\":\"preseason\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|season|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The period before the start of a sporting season, during which players undergo training and venues are prepared\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preseeding", "{\"term\":\"preseeding\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a way to set answers to questions asked during the installation process, without having to manually enter the answers while the installation is running\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Joey Hess, \u0026quot;\u0026lt;tt\u0026gt;d-i preseed file version 0.1\u0026lt;/tt\u0026gt;\u0026quot;, reprinted in Frank Ronneburg, 2005, \u0027Debian GNU/ Linux Anwenderhandbuch\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dV5wR73e-zzIC\u0026amp;pg\u003dPA122\u0026amp;dq\u003dpreseeding\u0026amp;sig\u003dC9OkkF5HCE2X4gxQ5qKJzTaLhN\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"PPA117,M1]\u0026lt;/sup\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Some parts of the installation process cannot be automated using some forms of \u0027\u0027preseeding\u0027\u0027, because the questions are asked before the preseed file is loaded\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Frank Ronneburg, \u0027Debian GNU/Linux Anwenderhandbuch für Einsteiger, Umsteiger und Fortgeschrittene\u0027, [http://books.google.com/books?id\u003dNsZUkn05IWwC\u0026amp;pg\u003dPA124\u0026amp;dq\u003dafter-preseeding++-pre-seeding\u0026amp;lr\u003dlang_en\u0026amp;as_brr\u003d3\u0026amp;ei\u003dDTk8ScKpEYLeyASc_LWbAg page 124] ([http://www.informit.de/9783827323033.html?SID\u003d{BCA347AE-8125-4731-82EE-525F5A5AF3D4}\u0026amp;SID\u003d{EE40DE6B-91FB-4F2D-AD1A-007A165BE36D} Pearson Education]; ISBN 978‒3‒8273‒2303‒3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This first command is run as early as possible, just after \u0027\u0027preseeding\u0027\u0027 is read\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, [http://fixunix.com/debian/522861-etch-n-half-netboot-problems.html \u0026quot;etch-n-half netboot problems\u0026quot;], \u0027Unix Linux Forum\u0027, Aug 1\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I\u0027m using \u0027\u0027preseeding\u0027\u0027 over network(PXE).\u0026lt;!-- if satisfactorily verified this sense should be moved to preseed and this section removed --\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

	add("preselection", "{\"term\":\"preselection\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|selection|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process by which a candidate for public office is selected, usually by a political part\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Selection in advanc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("presence", "{\"term\":\"presence\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Through Old french (842-ca. 1400) \u0027presence\u0027 from Latin \u0027praesentia\u0027 (a being present) from \u0027praesentem\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact or condition of being present, or of being within sight or call, or at hand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Carried somehow, somewhither, for some reason, on these surging floods, were these travelers, of errand not wholly obvious to their fellows, yet of such sort as to call into query alike the nature of their errand and their own relations. It is easily earned repetition to state that Josephine St. Auban\u0027s was a \u0027\u0027presence\u0027\u0027 not to be concealed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The part of space within one\u0027s immediate vicinity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A quality of poise and effectiveness that enables a performer to achieve a close relationship with his audience\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something (as a spirit) felt or believed to be present\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A company\u0027s business activity in a particular market\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The state of being closely focused on the here and now, not distracted by irrelevant thoughts\", \"priority\":7}]}, \"synonyms\":{}}");

	add("presentability", "{\"term\":\"presentability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being presentable; acceptable appearance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("presenter", "{\"term\":\"presenter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|present}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who presents a broadcast programme; a compere or master of ceremonies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who presents a thing or person to someone else\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A small handheld device used to remotely control a computerised slide show\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Part of a special GUI software that assumes the functionality of the \u0026quot;middle-man\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("presentment", "{\"term\":\"presentment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027presentment\u0027 \u0027\u0027 Middle french (ca. 1400-1600) \u0027presentement\u0027 corresponding to {{suffix|present|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statement made on oath by a jury\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Peter Kolchin, \u0027American Slavery\u0027, Penguin History, paperback edition, page 62\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In 1771, a grand jury \u0027\u0027presentment\u0027\u0027 in Georgia revealed that \u0026quot;Slaves are permitted to rent houses [...].\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The notice taken by a grand jury of any offence from their own knowledge or observation, without any bill of indictment laid before them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027presentment\u0027\u0027 of a nuisance, a libel, etc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A formal complaint submitted to a bishop or archdeacon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Raymond Grant, \u0027The Royal Forests of England\u0027, Alan Sutton 1991\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He recognised that there was general resentment of the oppressive conduct of the Forest officers, and made provision for regular inquiries into it, and for \u0027\u0027presentment\u0027\u0027 of Forest offences to be made at the attachment courts, as a procedure preliminary to the Forest Eyre\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The act of presenting something for acceptance; now specifically, presenting something (e.g. a bill or cheque) for payment\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Sarah Rose, \u0026quot;The Truth about Online Banking\u0026quot;, \u0027Money\u0027, vol. 29.4\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"When online bill \u0027\u0027presentment\u0027\u0027, which removes all the paperwork, becomes widespread, says McKinsey\u0027s Stephenson, online banking will be far more compelling\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An artistic representation; a picture\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, \u0026quot;Arts: In Washington\u0026quot;, \u0027Time\u0027, 21 Dec 1923\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Noted among the who\u0027s-who in portraiture: Hopkinson\u0027s Secretary Hughes, Childe Hassam\u0027s Governor Alfred E. Smith, of New York, Edmund C. Tarbell\u0027s Mary at the Harpsichord, Lillian Westcott Hale\u0027s child portrait study of Brothers, Frank Benson\u0027s Girl in Blue Jacket, and Marion Boyd Allen\u0027s \u0027\u0027presentment\u0027\u0027 of Anna Vaughn Hyatt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Presentation of a performance, as of a play or work of music\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The aspect or form in which something presents itself; appearance\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, Herman Melville, \u0027Moby-Dick\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"But it was especially the aspect of the three chief officers of the ship, the mates, which was most forcibly calculated to allay these colourless misgivings, and induce confidence and cheerfulness in every \u0027\u0027presentment\u0027\u0027 of the voyage\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The official notice (formerly required to be given in court) of the surrender of a copyhold estate\", \"priority\":19}]}, \"synonyms\":{}}");

	add("preservation", "{\"term\":\"preservation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027preservacion\u0027 from \u0027preservatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of preserving; care to preserve; act of keeping from destruction, decay or any ill\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"William Shakespeare, \u0027Henry VIII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nature does not require\u0027\u0026lt;br/\u0026gt;\u0027Her times of preservation, which, perforce\u0027\u0026lt;br/\u0026gt;\u0027I give my tendence to\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ecclesiastes. xxxiv. 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The eyes of the Lord are upon them that love him, his is ther mighty protection, a preservation from stumbling, and a help from falling\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"w:Sir John Sir John Davie\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Every seneseless thing by nature\u0027s light\u0027\u0026lt;br/\u0026gt;\u0027Doth preservation seek, destruction shun\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"w:John John Lock\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Our allwise maker has put into man the uneasiness of hunger, thirst and other natural desires, to determine their wills for the preservation of themselves, and the continuation of their species\", \"priority\":9}]}, \"synonyms\":{}}");

	add("preserve", "{\"term\":\"preserve\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|preserver}}, from {{m|la|preservare||keep, preserve}}, from {{m|la|praeservare||guard beforehand}}, present active infinitive of {{m|la|praeservo}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sweet spread made of any of a variety of berries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A reservation, a nature preserve\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1881\u0027\u0027, s:Robert Louis Robert Louis Stevenson, \u0027s:Virginibus Virginibus Puerisque\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Suppose Shakespeare had been knocked on the head some dark night in w:Thomas Sir Thomas Lucy\u0027s \u0027\u0027preserves\u0027\u0027, the world would have wagged on better or worse, the pitcher gone to the well, the scythe to the corn, and the student to his book; and no one been any the wiser of the loss\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An activity with restricted access\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579860-g8-pledges-tackle-three-ts-t-time T passage\u003dThe ability to shift profits to low-tax countries by locating intellectual property in them, which is then licensed to related businesses in high-tax countries, is often assumed to be the \u0027\u0027preserve\u0027\u0027 of high-tech companies\", \"priority\":6}]}, \"synonyms\":{}}");

	add("presheaf", "{\"term\":\"presheaf\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|sheaf|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A contravariant functor whose domain is a category whose objects are open sets of a topological space and whose morphisms are inclusion mappings.\u0026lt;ref\u0026gt;David Jao. \u0026quot;sheaf\u0026quot; (version 11). PlanetMath.org. Freely available at http://planetmath.org/?op\u003dgetobj;from\u003dobjects;id\u003d2878\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("president", "{\"term\":\"president\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027president\u0027 from Latin {{m|la|praesidēns||presiding over; president, leader}} (accusative: \u0027praesidentem\u0027 . The Latin word is the substantivized present active participle of the verb {{m|la|praesideō||preside over}}. The verb is composed from \u0027prae\u0027 (before) and {{m|la|sedeō||sit}}. The original meaning of the verb is \u0027to sit before\u0027 in the sense of presiding at a meeting. A secondary meaning of the verb is \u0027to command, to govern\u0027. So {{m|la|praesidēns}} means \u0027the presiding one on a meeting\u0027 or \u0027governor, commander\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The head of state of a republic, a representative democracy and sometimes a dictatorship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Benjamin Camins, Hillary Is the Best Choice, Page 14\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to change the pattern of the last 220 years of only voting for a white male president, and elect a woman president\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The vast majority of \u0027\u0027presidents\u0027\u0027 have been male\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Primary leader of a corporation. Not to be confused with CEO, which is a related but separate position that is sometimes held by a different person\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person presiding over a meeting, chair, presiding officer, presider\", \"priority\":6}]}, \"synonyms\":{}}");

	add("presidentialness", "{\"term\":\"presidentialness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|presidential|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being presidential; suitability for the presidency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Don F. Faules \u0026amp; Dennis C. Alexander, \u0027Communication and Social Behavior: A Symbolic Interaction Perspective\u0027, Addison-Wesley Publishing Co. (1978), ISBN 9780201019827, page 138\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For Carter, who during the primaries had emerged from the oblivion of \u0026quot;Jimmy who?\u0026quot;, the debates offered a challenge as well as an opportunity — to convince voters that his \u0026quot;\u0027\u0027presidentialness\u0027\u0027\u0026quot; was better than the incumbent\u0027s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Dan F. Hahn, \u0026quot;The 1992 Clinton-Bush-Perot Presidential Debates\u0026quot;, in \u0027Rhetorical Studies of National Political Debates, 1960-1992\u0027 (ed. Robert V. Friedenberg), Greenwood Publishing Group (1994), ISBN 0275943399, [http://books.google.com/books?id\u003dBvzJtGIy_1UC\u0026amp;pg\u003dPA200 page 200\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Likewise, Perot continued to work on the miscellaneous goal of proving his own \u0027\u0027presidentialness\u0027\u0027 via use of statistics and common sense\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Andrew Busch, \u0027The Constitution on the Campaign Trail: The Surprising Political Career of America\u0027s Founding Document\u0027, Rowman \u0026amp; Littlefield (2007), ISBN 9780742548480, [http://books.google.com/books?id\u003dsYvfKhXIdsgC\u0026amp;pg\u003dPA130 page 130\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Some scholars also suggest that debates activate the electorate, make it easier for candidates to be held accountable on their campaigns, increase the public\u0027s acceptance of the candidates, give voters a chance to test the \u0026quot;\u0027\u0027presidentialness\u0027\u0027\u0026quot; of the candidates under pressure\", \"priority\":7}]}, \"synonyms\":{}}");

