	add("pressotherapy", "{\"term\":\"pressotherapy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of physiotherapy in which external pressure is used to aid the circulation of the blood\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pressroom", "{\"term\":\"pressroom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|press|room|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The room in a public building where press conferences are give\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pressure", "{\"term\":\"pressure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) from Latin \u0027pressūra\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pressing; a force applied to a surface\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Apply \u0027\u0027pressure\u0027\u0027 to the wound to stop the bleeding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A contrasting force or impulse of any kin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027pressure\u0027\u0027 of poverty; the \u0027\u0027pressure\u0027\u0027 of taxes; the \u0027\u0027pressure\u0027\u0027 of motives on the mind; the \u0027\u0027pressure\u0027\u0027 of civilization\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Where the \u0027\u0027pressure\u0027\u0027 of danger was not felt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Distress\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She has felt \u0027\u0027pressure\u0027\u0027 lately because her boss expects her to get the job done by the first\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"My people\u0027s \u0027\u0027pressures\u0027\u0027 are grievous\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In the midst of his great troubles and \u0027\u0027pressures\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Urgenc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027pressure\u0027\u0027 of business\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Impression; stamp; character impressed\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"All saws of books, all forms, all \u0027\u0027pressures\u0027\u0027 past\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The amount of force that is applied over a given area divided by the size of this area\", \"priority\":14}]}, \"synonyms\":{}}");

	add("presternum", "{\"term\":\"presternum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|sternum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The anterior segment of the sternum; the manubrium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("prestidigitation", "{\"term\":\"prestidigitation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French {{m|fr|prestidigitation}}: from French {{m|fr|preste||nimble, quick}}:: from Italian {{m|it|presto}}::: from {{m|la|praestus||ready at hand}}: + Latin {{m|la|digitus||finger}}: + noun of process suffix {{m|fr|-ation}}:: from Latin perfect passive participle suffix {{m|la|-atus}}:: + suffix {{m|la|-io}}.* \u0027Note:\u0027 despite the phonetic similarities, the words prestidigitator and prestidigitation have different origins from those of prestige, even though this in the past has meant \u0026quot;delusion, illusion, trick\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A performance of or skill in performing magic or conjuring tricks with the hands; sleight of hand\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My favorite \u0027\u0027prestidigitation\u0027\u0027 was when he pulled the live dove out of that tiny scarf\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A show of skill or deceitful cleverness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His writing was peppered with verbal tricks and \u0027\u0027prestidigitation\", \"priority\":4}]}, \"synonyms\":{}}");

	add("prestige", "{\"term\":\"prestige\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027lang\u003dfr|prestige\u0027 () , from Latin \u0027lang\u003dla|praestigium\u0027 () : , from \u0027lang\u003dla|praestinguere\u0027 () :: , from \u0027lang\u003dla|prae\u0027 () + \u0027lang\u003dla|stinguere\u0027 () lt;!--from Century 1911 and Webster 1913--\u0026gt;; or:: , from \u0027lang\u003dla|praestringere\u0027 () :: , from \u0027lang\u003dla|prae\u0027 () + \u0027lang\u003dla|stringere\u0027 () lt;!--from modern dictionaries online--\u0026gt;.* \u0027Note:\u0027 despite the phonetic similarities and prestige\u0027s old meaning of \u0026quot;delusion, illusion, trick\u0026quot;, the word has a different root than prestidigitator and prestidigitation.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Delusion; illusion; trick\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:William William Warburton\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sophisms of infidelity, and the \u0027\u0027prestiges\u0027\u0027 of imposture. \u0026lt;!-- Webster 1931 --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The quality of how good the reputation of something or someone is, how favourably something or someone is regarded\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Oxford has a university of very high \u0027\u0027prestige\", \"priority\":5}]}, \"synonyms\":{}}");

	add("presto", "{\"term\":\"presto\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027lang\u003dit|presto\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pair of fives as a starting hand in Texas hold \u0027em\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preston", "{\"term\":\"preston\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|prēost||priest}} + {{m|ang|tūn||settlement}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An industrial city in Lancashire, England\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Several other towns and villages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An English surname derived from any of the placenames\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":4}]}, \"synonyms\":{}}");

	add("presumptuousness", "{\"term\":\"presumptuousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|presumptuous|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being presumptuous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("presupposition", "{\"term\":\"presupposition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027présupposition\u0027 from Latin \u0027praesuppositio\u0027 from the past participle stem of \u0027praesupponere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An assumption made beforehand; a preliminary conjecture or speculation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Guy Deutscher, \u0027Through the Language Glass\u0027, Arrow 2011, p. 40\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He made one cardinal error in his \u0027\u0027presuppositions\u0027\u0027 about the relation between language and perception, but in this he was far from alone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of presupposing\", \"priority\":4}]}, \"synonyms\":{}}");

	add("presymmetry", "{\"term\":\"presymmetry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|symmetry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The electroweak symmetry of quarks and leptons that is responsible for the partial charges on quarks\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preteenager", "{\"term\":\"preteenager\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pre|teenager|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person of somewhat less than 13 years of ag\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pretender", "{\"term\":\"pretender\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|pretend}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who professes beliefs and opinions that they do not hold\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A claimant to an abolished or already occupied throne\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pretense", "{\"term\":\"pretense\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027pretensse\u0027 from \u0027\u0027 past participle of \u0027prætendere\u0027 () from \u0027præ-\u0027 () + \u0027tendere\u0027 () see pretend.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A false or hypocritical profession, as, under \u0027pretense\u0027 of friendliness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Intention or purpose not real but professed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"with only a \u0027\u0027pretense\u0027\u0027 of accuracy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unsupported claim made or implied\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An insincere attempt to reach a specific condition or quality\", \"priority\":5}]}, \"synonyms\":{}}");

	add("preterism", "{\"term\":\"preterism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|preterit|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Christian eschatological view that interprets Biblical prophecies as events which happened in the first century\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preternaturality", "{\"term\":\"preternaturality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|preternatural|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being preternatural\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preternaturalness", "{\"term\":\"preternaturalness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|preternatural|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being preternatural\", \"priority\":1}]}, \"synonyms\":{}}");

	add("preternature", "{\"term\":\"preternature\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|preter|nature|lang\u003den}}, after \u0027preternatural\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The realm beyond the natural; the preternatural\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027, ‘The Mystery of Marie Rogêt’\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In my own heart there dwells no faith in \u0027\u0027preter-nature\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Stuart Clark, \u0027Thinking with Demons: The Idea of Witchcraft in Early Modern Europe\u0027, page 263\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We can speak here too, then, of pressure and, indeed, encroachment by the category of \u0027\u0027preternature\u0027\u0027 on territory previously occupied by the miraculous\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pretext", "{\"term\":\"pretext\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027prétexte\u0027 from Latin \u0027praetextum\u0027 (an ornament, etc., wrought in front, a pretense) neuter of \u0027\u0027 past participle of \u0027praetexere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A false, contrived, or assumed purpose or reason; a pretense\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The reporter called the company on the \u0027\u0027pretext\u0027\u0027 of trying to resolve a consumer complaint\", \"priority\":2}]}, \"synonyms\":{}}");

