	add("pretzel", "{\"term\":\"pretzel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"Latin\"], \"text\":\"Image:Pretzel 01-14.jpg|thumb|A pretzelFrom German \u0027pretzel\u0027 \u0027brezel\u0027 from *\u0027|brachiatellum\u0027 (brachiatellum) from diminutive of Latin \u0027bracchium\u0027 (arm) named for the appearance of arms folded in prayer.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A toasted bread or cracker usually in the shape of a loose knot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything that is knotted, twisted, or tangled\", \"priority\":2}]}, \"synonyms\":{}}");

	add("prevarication", "{\"term\":\"prevarication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027prevaricaciun\u0027 Middle french (ca. 1400-1600) \u0027prevarication\u0027 and their source, Latin \u0027praevaricatio\u0027 (collusion with an opponent; transgression; deceit) from the stem of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Deviation from what is right or correct; transgression, perversion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Evasion of the truth; deceit, evasiveness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Prevarication\u0027\u0027 became the order of the day in his government while truth was a stranger in those halls\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The august tribunal of the skies, where no \u0027\u0027prevarication\u0027\u0027 shall avail\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, The Economist, Oct 6th 2012, [http://www.economist.com/node/21564238 Charlemagne: Mysterious Mariano\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Mr Rajoy frustrates many with his \u0027\u0027prevarication\u0027\u0027 over a fresh euro-zone bail-out, which now comes with a conditional promise from the European Central Bank (ECB) to help bring down Spain’s stifling borrowing costs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A secret abuse in the exercise of a public office\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The collusion of an informer with the defendant, for the purpose of making a sham prosecution\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A false or deceitful seeming to undertake a thing for the purpose of defeating or destroying it\", \"priority\":10}]}, \"synonyms\":{}}");

	add("prevention", "{\"term\":\"prevention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"{{suffix|prevent|tion|lang\u003den}} or equivalent. Compare French \u0027prévention\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of going, or state of being, before\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The greater the distance, the greater the \u0027\u0027prevention\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Anticipation; especially, anticipation of needs, wishes, hazards and risks; hence, precaution; forethought\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of preventing or hindering; obstruction of action, access, or approach; thwarting\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Casca, be sudden, for we fear \u0027\u0027prevention\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Medicine) Any measure such as information campaigns, vaccination, early diagnosis etc., intended to limit health-related risks\", \"priority\":8}]}, \"synonyms\":{}}");

