	add("previous", "{\"term\":\"previous\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An existing criminal record; short for \u0026quot;previous convictions\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It turned out the shoplifter had a lot of \u0027\u0027previous\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"November 2 2014\u0027\u0027, Daniel Taylor, \u0026quot;[http://www.theguardian.com/football/2014/nov/02/manchester-city-manchester-united-premier-league-match-report Sergio Agüero strike wins derby for Manchester City against 10-man United],\u0026quot; \u0027guardian.co.uk\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For that Smalling will have to do his time grazing in the scapegoat’s paddock because his contribution here supplied hard evidence of a player lacking the football intelligence that is needed at the highest level. He has \u0027\u0027previous\u0027\u0027 on that front and it is difficult to find any mitigation for the way he scythed down James Milner when the first rule for a defender on a yellow card is not to dive in unless it is absolutely necessary\", \"priority\":4}]}, \"synonyms\":{}}");

