	add("prevision", "{\"term\":\"prevision\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From French \u0027prévision\u0027 from Old french (842-ca. 1400) from Latin \u0027praevisio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Advance knowledge; foresight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"it was the beginning for her of a deeper \u0027\u0027prevision\u0027\u0027 that, in spite of Miss Overmore\u0027s brilliancy and Mrs. Wix\u0027s passion, she should live to see a change in the nature of the struggle she appeared to have come into the world to produce\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, \u0027History of Western Philosophy\u0027, I.21\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The whole discussion is concerned with City States, and their is no \u0027\u0027prevision\u0027\u0027 of their obsolescence\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A prediction\", \"priority\":6}]}, \"synonyms\":{}}");

